comment:
뭔 분량이 짧아
대사가 얼마 없어서 그렇지 컷수도
그리 차이 안 나는데;

오정규가 차차 위해서 자살하면 ㄹㅇ 망한거 아닌가...
차차는 얻을 거 다 얻고서도 오정규 하나때문에 자유롭지 못했는데
오정규가 자살하면 그냥 고삐풀린 망아지 수준이 아니라 봉인 해제된 용 느낌;;;

나노 정도 또래에 교복은 그냥 평범한 거 아님??
머릿속에 뭘 상상하는건지;;;

궁금한 건 모든 것이 철두철미한 안도화가 나노를 도진이에게 보냈을 때 일어날 수 있는 일을 몰랐을 리가 없는데 왜 그런 건지...

제일잘못한건 안도화가 아니라
msa랑 차차년이지;
결과적으로 도진이 저렇게 망친게 차차샹X인데

초록잎 개싫다..지 목적을 위해서 상황만들어놓고 도진이한테 똥닦으라네.

결국 초록잎목적을 위해서 나노 도진이 이용하는거에요.

속지마세요 님들;

왜 초록잎이 현실적인 조언을 했다고 하지?;
저건 도진이에게 책임전가 하는 꼴인데;;
나노를 막을 수 있는 건 도진이 밖에 없지만 도진이가 그걸 꼭 해야 할 이유가 없음.
애꿎은 사람이 죽어가고, 나노를 제어할 수 있는 나노에게 사랑받는 사람이라?
그래서 피해란 피해는 다 받고 수습은 해줘야 함?
책임전가 대박이다. 여기서 도진아 네가 정신차려야 해ㅠ 하는 거 진짜 아닌 듯.
